        json.writeEndObject();

        json.writeStringField("job_id", result.getJobID().toString());
        json.writeNumberField("runtime_ms", result.getNetRuntime());

        json.writeObjectFieldStart("parameters");
        for (Map.Entry<String, String> entry :
