private int compareNamespaceAndNode(
        MemorySegment namespaceSegment,
        int namespaceOffset,
        int namespaceLen,
        long targetNode) {
    Node nodeStorage = getNodeSegmentAndOffset(targetNode);
    MemorySegment targetSegment = nodeStorage.nodeSegment;
