    int targetKeyOffset = offsetInSegment + SkipListUtils.getKeyDataOffset(level);

    return SkipListKeyComparator.compareNamespaceAndNode(
            namespaceSegment, namespaceOffset, namespaceLen, targetSegment, targetKeyOffset);
}

