                .whenComplete(
                        (Object ignored, Throwable throwable) -> {
                            jobMasterMainThreadExecutor.assertRunningInMainThread();
                            if (throwable != null) {
                                releaseFuture.completeExceptionally(throwable);
                            } else {
                                releaseFuture.complete(null);
                            }
                        });
    } else {

        releaseFuture.complete(null);
    }
}

