            fail("The rest request should have failed.");
        } catch (Exception e) {
            assertThat(
                    ExceptionUtils.findThrowableWithMessage(e, exceptionMessage).isPresent(),
                    is(true));
        } finally {
            restClusterClient.close();
        }
    }
