                            task.id()),
                        timeoutException
                    );

                    allRunning = false;
                }
            } else {


                allRunning = false;
            }
        }
    }
    if (allRunning) {

        mainConsumer.resume(mainConsumer.assignment());
        changelogReader.transitToUpdateStandby();
    }

    return allRunning;
}

