      sampleTimeUs = timestampAdjuster.adjustSampleTimestamp(sampleTimeUs);
    }
    for (TrackOutput emsgTrackOutput : emsgTrackOutputs) {
      emsgTrackOutput.sampleMetadata(
          sampleTimeUs, C.BUFFER_FLAG_KEY_FRAME, sampleSize,  0, null);
    }
  }
