  boolean bitrateSupported =
      format.averageBitrate == Format.NO_VALUE
          || EncoderUtil.getSupportedBitrateRange(encoder, mimeType)
              .contains(format.averageBitrate);
  return sizeSupported && bitrateSupported;
}

