	if (this.expired) {
		return;
	}
	Object resultToHandle;
	synchronized (this) {

		if (this.expired) {
			return;
		}
		resultToHandle = this.result;
		if (resultToHandle == RESULT_NONE) {

			this.resultHandler = resultHandler;
			return;
		}
	}



	try {
		resultHandler.handleResult(resultToHandle);
	}
	catch (Throwable ex) {
		logger.debug("Failed to process async result", ex);
	}
}

